import React from "react";
import "./styles.scss";

export function Header() {
  return (
    <div className="header">
      <img
        src={require("../../assets/images/sp_2.png")}
        alt=""
        className="header--circle"
      />
      <h1 className="header--title">{"Find your job better and faster"}</h1>
      <p className="header--description">
        {"Find your best job better and faster with Jobest"}
      </p>
      <img
        src={require("../../assets/images/sp_1.png")}
        alt=""
        className="header--img"
      />
      <div className="searchBar">
        <input
          className="searchBar--input"
          placeholder="Seacrh by skill, company and job"
          maxLength="42"
        />
        <img
          src={require("../../assets/images/search2.png")}
          alt=""
          className="searchBar--icon"
        />
      </div>
    </div>
  );
}
